    ap_done <= write_to_output_U0_ap_done;
    ap_idle <= (write_to_output_U0_ap_idle and process_kernel_U0_ap_idle and fetch_from_hbm_U0_ap_idle and entry_proc_U0_ap_idle);
    ap_ready <= ap_sync_ready;
