    ap_sync_fetch_from_hbm_U0_ap_ready <= (fetch_from_hbm_U0_ap_ready or ap_sync_reg_fetch_from_hbm_U0_ap_ready);
    ap_sync_ready <= (ap_sync_fetch_from_hbm_U0_ap_ready and ap_sync_entry_proc_U0_ap_ready);
    entry_proc_U0_ap_continue <= ap_const_logic_1;
    entry_proc_U0_ap_start <= ((ap_sync_reg_entry_proc_U0_ap_ready xor ap_const_logic_1) and ap_start);
    fetch_from_hbm_U0_ap_continue <= ap_const_logic_1;
    fetch_from_hbm_U0_ap_start <= ((ap_sync_reg_fetch_from_hbm_U0_ap_ready xor ap_const_logic_1) and ap_start);
    gmem_BID <= ap_const_lv1_0;
